    projectId: "trim-cistern-312509",
    storageBucket: "trim-cistern-312509.appspot.com",
    messagingSenderId: "652925792968",
    appId: "1:652925792968:web:5c3f111585e90536f56bfd",
    measurementId: "G-T1JG54ME2N"
};

// Initialize Firebase
export const app = initializeApp(firebaseConfig);
